// function to return JSX(HTML in side JavaScript)
// return "Let's get started!" as a header
function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is a paragraph!!</p>
    </div>
  );
}

export default App; // expoert the fuctoin to be able to use it in other files
